import React from "react";

const Explore = () => {
  const url = "/images/explore.jpg";

  return (
    <div>
      <h1>Explore Airbnb</h1>
      <div style={{ width: "389.33px", height: "84px" }}>
        <div
          style={{
            width: "126px",
            height: "84px",
            backgroundImage: `url(${url})`,
            backgroundSize: "cover"
          }}
        >
          <div>
            <h2 style={{ padding: "0px 16px 0px 24px" }}>Stays</h2>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Explore;
